import React from 'react';
import { NavLink } from 'react-router-dom';
import './Sidebar.css';

const Sidebar = () => {
  return (
    <aside className="sidebar">
      <ul>
        <li><NavLink to="/" end activeClassName="active">Dashboard</NavLink></li>
        <li><NavLink to="/assets" activeClassName="active">Assets</NavLink></li>
        <li><NavLink to="/purchases" activeClassName="active">Purchases</NavLink></li>
        <li><NavLink to="/transfers" activeClassName="active">Transfers</NavLink></li>
        <li><NavLink to="/assignments" activeClassName="active">Assignments</NavLink></li>
        <li><NavLink to="/expenditures" activeClassName="active">Expenditures</NavLink></li>
        <li><NavLink to="/logs" activeClassName="active">Logs</NavLink></li>
      </ul>
    </aside>
  );
};

export default Sidebar;
